Patch Set 2: Code-Review-1

(3 comments)

The problem with this design is that once there's any kind of config tree on target, new config section changes in .adef and .sdef will be ignored.  I think what we need is for the config tree settings in the def files to be available as defaults that get returned if those specific nodes are missing from the config tree.

One solution might be to generate accessor functions (getters and setters) for these def file settings.  So,

 config:
 {
     enabled: false
 }

Would generate the functions

 bool config_GetEnabled(le_cfg_IteratorRef_t i);
 void config_SetEnabled(le_cfg_IteratorRef_t i, bool value);

config_GetEnabled() would check the config tree for a leaf node called "enabled", and if the node doesn't exist (or is a stem node), then the default value (false) would be returned.

Alternatively, there could be generic functions that look up the default value in a generated table.

 bool config_GetBool(le_cfg_IteratorRef_t i, const char* nodePath);
 void config_GetString(le_cfg_IteratorRef_t i, const char* nodePath, char* valueBuff, size_t buffSize);
 ...
